import React from "react";
import { Row, Col, Button } from "reactstrap";

import Widget from "../../components/Widget";
// import s from "./Static.module.scss";

const Reviews = () => (
	<div>
		<h1 className="page-title">
			Reviews - <span className="fw-semi-bold">Getting an analysis</span>
		</h1>
		<Widget
			title={
				<h5>
					Headings{" "}
					<small className="text-muted">Default and customized</small>
				</h5>
			}
		>
			<h4>Default headings</h4>
			<p>Basic headings for everyday use</p>
			<form>
				<textarea type="text" rows="5" style={{ border: "1px solid #d6dee5 !important" }} background="White" class="form-control" placeholder="Введите текст вашего отзыва здесь..."></textarea>
				<Button color="default" className="mr-2" size="sm">Отправить</Button>
			</form>
		</Widget>
	</div>
);

export default Reviews;
